import React, { Component } from 'react';
import { Container, Row, Col, Image } from 'react-bootstrap';
import './css/request.css';

export default class Request extends Component {
  render() {
    return (
      <Container>
        <Jumbotron>
          <h2>Request</h2>
        </Jumbotron>
      </Container>
    )
  }
}
